export default function ContactBox({props}) {
    return (

        <div>
            <div className="contact-card">
                <img src= {props.img}/>
                <h3>{props.name}</h3>
                <div className="info-group">
                    <img src={require("../images/phone-icon.png")} />
                    <p>{props.phone}</p>
                </div>
                <div className="info-group">
                    <img src={require("../images/mail-icon.png")} />
                    <p>{props.email}</p>
                </div>
            </div>
        </div>

    )
}

